import React from "react";
import './index.css';
import ReactDOM from "react-dom/client";
import App from "./App";
import ThemeContextWrapper from "./components/theme";

const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(
  <ThemeContextWrapper>
  <React.StrictMode>
    <App />
  </React.StrictMode>
  </ThemeContextWrapper>,
);
